import './Header.css';
import image from './TAHAR.png';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className='header-container'>

      <Link to='/'><img className='header-icon' src={image} alt='LOGO'></img></Link>

      <div className='header-link-container'>
        <div>
          <h1>Tahar Garage Door Repair Services</h1>
        </div>
        <div>
        <Link className='header-link' to='/reviews'>Reviews</Link>
        <Link className='header-link' to='/services'>Services</Link>
        <Link className='header-link' to='/about'>About</Link>
        <Link className='header-link' to='/gallery'>Gallery</Link>
        <Link className='header-link' to='/faq'>FAQ</Link>
        <Link className='header-link' to='/contact'>Contact</Link>
        </div>
      </div>

      <div className='header-quote-button-container'>
        <Link className='header-quote-button' to='/getquote'>Request A Free Quote</Link>
      </div>

    </div>
  );
};

export default Header;
